  [],\n\t\"revision_timestamp\": \"2015-09-26T21:27:25.771777\",\n\t\"name\": \"nitrate-nitrite-content-concentration-phosphate-dissolved-oxygen-nitrite-and-other-profile-and-\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0112533 includes profile,
  discrete sample and chemical data collected aboard the LAURENCE M. GOULD during
  cruises LMG0104, LMG0106, LMG0203 and LMG0205 in the South Atlantic Ocean and South
  Pacific Ocean from 2001-04-29 to 2002-09-09. These data include NITRATE + NITRITE
  CONTENT (CONCENTRATION), PHOSPHATE, DISSOLVED OXYGEN, NITRITE, SILICATE, AMMONIUM
  and NITRATE. The instruments used to collect these data include bottle and CTD.
  These data were collected by Kent Fanning of University of South Florida as part
  of Southern Ocean GLOBEC. The Biological and Chemical Oceanography Data Management
  Office (BCO-DMO) submitted these data to NODC on 2013-07-25.nnThe following is the
  text of the abstract provided by BCO-DMO:nnNitrate, nitrite, phosphate, ammonia,
  and silica were measured from selected niskin bottle tripped from hydrocasts on
  LMGould cruises from 2001 and 2002 in the Southern Ocean. Water samples were not
  taken on all casts. All concentrations are reported in micromoles per liter. For
  2002 cruises, the oxygen is also reported.\",\n\t\"license_title\": null,\n\t\"extras\":
